return(
<>
{
  props.dara.map((curr,currIndex)=>{


  return (
    <div className="main_navbar">
      <div className="leftbox">
        <img src={logo} alt="" />
      </div>
      <div className="rightbox">
        <p>Name : {curr.cardData.Name}</p>
        <h1>Price : {curr.c}</h1>
      {/* <ion-icon name="cart"></ion-icon> */}
      
      </div>
    </div>
  )
})
}
  </>
)
}

